import { Container, Card, Avatar, Typography } from "@mui/material";

type MatchCardProps = any;

export default function MatchCard(props: MatchCardProps) {
  return (
    <Card sx={{
      height: '15vh', 
      border: 'solid',
      borderRadius: '3.5vw',
      display: 'flex',
      flex: 'column',
      margin: '1vh',
    }}>
      <Container sx={{
        display: 'flex',
        flex: 'column',

      }}>
        <Avatar
          alt="장원영"
          src="./13131.jpeg"
          sx={{ 
            width: '8vh', 
            height: '8vh',
            margin: '0.5rem',
          }}
        />
        <Typography>Wonyoung Jang</Typography>
      </Container>
    </Card>
  )
}
